-- Name: calculate_pol_tax(character varying, character varying, character varying, character varying, character varying, character varying, character varying); Type: FUNCTION; Schema: di_import_repo; Owner: postgres
--

CREATE FUNCTION di_import_repo.calculate_pol_tax(temp_table_name character varying, policy_number_column character varying, premium_column_name character varying, tsa_type_column_name character varying, tsa_amount_column_name character varying, commission_paid_column character varying, state_code_column character varying) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
BEGIN

    drop table if exists di_temp.pol_temp;

    execute format('create table di_temp.pol_temp as select * from di_temp.'||temp_table_name);

    execute format('update di_temp.pol_temp 
    set '|| tsa_type_column_name ||'= $1', || tsa_amount_column_name || '= round((('|| premium_column_name ||')::numeric/100)*slst.surplus_lines_tax_rate,2),
    from di_temp.states_info slst where '|| state_code_column || '= slst.state_codes') using 'TAX';

    execute format('update di_temp.'||temp_table_name ||' set '|| tsa_type_column_name || '= null , '|| tsa_amount_column_name|| ' = null');

    execute format('update di_temp.pol_temp set' || premium_column_name ||' = null');

    execute format('insert into di_temp.'||temp_table_name||' select * from di_temp.pol_temp');
raise notice 'Failed';

return true;
END
$_$;


