--
-- Name: calculate_premium_tax(character varying, character varying, character varying, character varying, character varying, character varying, character varying); Type: FUNCTION; Schema: di_import_repo; Owner: postgres
--

CREATE FUNCTION di_import_repo.calculate_premium_tax(prm_temp_table_name character varying, policy_number_column character varying, premium_column_name character varying, tsa_type_column_name character varying, tsa_amount_column_name character varying, commission_paid_column character varying, state_code_column character varying) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
BEGIN

drop table if exists di_temp.aggregate_premium;

    -- Temp Table with aggregate_premium and policy_number 
execute format('create table di_temp.aggregate_premium as
select sum(replace('||premium_column_name||','','','''')::numeric) as premium , '|| policy_number_column || ' , '|| state_code_column ||' as state_code 
from di_temp.'|| prm_temp_table_name ||' group by ' || policy_number_column|| ', '||state_code_column );

    -- Formulae to calculate Tax based on the lookup value from di_import_repo.surplus_lines_state_taxes table
--    Update aggregate_premium with calculated_tax
execute format('update di_temp.aggregate_premium ap set premium = round((ap.premium / 100) * slst.surplus_lines_tax_rate,2)
from di_import_repo.surplus_lines_state_taxes slst
where slst.state_codes = ap.state_code');

drop table if exists di_temp.row_number_table;
-- adding row_number to get only 1 record per policy_number
execute format('create table di_temp.row_number_table as
select *  ,row_number() over (partition by '|| policy_number_column ||')
from di_temp.'|| prm_temp_table_name ||'
where '|| policy_number_column ||' in ( select '|| policy_number_column ||' from di_temp.'|| prm_temp_table_name ||' group by '|| policy_number_column ||')');

drop table if exists di_temp.unique_prm_policy_list;
-- creating unique policy_number rows
execute format('create table di_temp.unique_prm_policy_list as
select * from di_temp.row_number_table where row_number =1');

-- removing row_nuber column before inserting unique into prm_temp table
execute format('alter table di_temp.unique_prm_policy_list drop column row_number');

-- update TSA_AMOUNT and TSA_TYPE columns in unique table
execute format('update di_temp.unique_prm_policy_list ul set ' || tsa_type_column_name ||' = $1, '|| tsa_amount_column_name ||'= ap.premium 
from di_temp.aggregate_premium ap
where ap.'|| policy_number_column ||' = ul.'|| policy_number_column) using 'TAX';

-- update TSA_AMOUNT and TSA_TYPE to empty in original PRM table
execute format('update di_temp.'||prm_temp_table_name||' set '||tsa_type_column_name||' = null,'||tsa_amount_column_name||'=null');

if commission_paid_column = '' then
    execute format('update di_temp.unique_prm_policy_list set '||premium_column_name||' = null');
else
    -- update commission_paid and perimum_amount to empty in calculated tax table
    execute format('update di_temp.unique_prm_policy_list set '||commission_paid_column || '= null,'|| premium_column_name||'=null');
end if;   
-- Insert updated unique table into prm temp table
execute format('insert into di_temp.'||prm_temp_table_name||' select * from di_temp.unique_prm_policy_list');

raise notice 'false';

return true;
End;
$_$;


